        </Navbar.Brand>

        <div className='hidden'>
          <h2>NETFLIX & CHILL</h2>
        </div>

        <Navbar.Toggle />
        <Navbar.Collapse id="coll">
          <Nav id="barItems">
            <Nav.Link to="/movies/1">Home</Nav.Link>
            <Nav.Link to="/contact">Contact</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    </div>
  );
};

export default navbar;
